import React from 'react';
import { TextField, Grid, Button } from '@mui/material';

const PaginaInputs = () => {
  return (
    <div>
      <h1>PÃ¡gina com Inputs</h1>
      <Grid container spacing={2}>
        {/* Primeira linha com 3 inputs */}
        <Grid item xs={4}>
          <TextField label="Input 1" fullWidth />
        </Grid>
        <Grid item xs={4}>
          <TextField label="Input 2" fullWidth />
        </Grid>
        <Grid item xs={4}>
          <TextField label="Input 3" fullWidth />
        </Grid>

        {/* Segunda linha com 2 inputs */}
        <Grid item xs={6}>
          <TextField label="Input 4" fullWidth />
        </Grid>
        <Grid item xs={6}>
          <TextField label="Input 5" fullWidth />
        </Grid>
      </Grid>

      <Button variant="contained" color="primary">Salvar</Button>
    </div>
  );
};

export default PaginaInputs;
